import React from 'react';
import {Route, Switch } from 'react-router-dom'
import Login from './components/Login'
import PrivateRoute from './components/PrivateRoute'
import './App.css';
import Signup from './components/Signup';
import DinerDash from './components/Diner/DinerDash'
import {DinersListProvider} from './Contexts/DinerContext'
// import {DinerProvider} from './Contexts/DinerContext'
import {DinerTrucksProvider} from './Contexts/DinerContext'


function App() {
  return (
    <DinerTrucksProvider>
    <DinersListProvider>
    <div className="App">
    <Switch>
    <Route path='/' exact component ={Login}/>
    <Route path='/Signup' component={Signup}/>
    <PrivateRoute path='/Diner/DashBoard' component={DinerDash}/>
    </Switch>
    </div>

    </DinersListProvider>
    </DinerTrucksProvider>
  );
}

export default App;
